import Link from 'next/link';

const LandingPage = () => (
    <div>
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
        <style jsx>{`
            body {
                background:url('/static/background.png')
            }
        `}</style>
    </div>
);

export default LandingPage;
